import * as style from "../../css/light/profileListContainer"

//Fix text moving on item highlight

export default function ProfileListItem({data}) {
  const convertData = () => {
    let temp = []
    Object.keys(data).slice(1).forEach((item, i) => {
      temp.push(data[i]['data'])
    })
  
    return temp.splice(1)
  }

  const renderListDataMain = () => {
    return <div style={style.profileListContainerMain}>
      {data[0]['data']}
    </div>
  }

  const renderListDataOther = () => {
    return convertData().map((item, i) => (
      <div key={`LData${i}`} style={style.profileListContainerItem}>{item}</div>
    ))
  }

  return (
    <div>
      <div 
      onMouseEnter={(e) => {
        e.currentTarget.style.border = "2px solid #4382BC"
        e.currentTarget.style.height = "20px"
        e.currentTarget.style.width = "calc(65vw - 30px)"
        e.currentTarget.children[0].style.lineHeight = "20px"
        e.currentTarget.children[0].style.paddingRight = "1px"
        e.currentTarget.children[1].style.width = "100%"
        e.currentTarget.children[0].style.minWidth = "198px"
        // e.currentTarget.children
        // Object.keys(e.currentTarget.children[1].children).forEach((item, i) => {
        //   e.currentTarget.children[1].children[i].style.lineHeight = "18px"
        // })
      }}
      onMouseLeave={e => {
        e.currentTarget.style.border = ""
        e.currentTarget.style.height = "22px"
        e.currentTarget.style.width = "calc(65vw - 28px)"
        e.currentTarget.children[0].style.lineHeight = "22px"
        e.currentTarget.children[0].style.paddingRight = ""
        // e.currentTarget.children[1].style.lineHeight = "20px"
        e.currentTarget.children[0].style.minWidth = "200px"
        e.currentTarget.style.border = "1px solid #4382BC"
        // Object.keys(e.currentTarget.children[1].children).forEach((item, i) => {
        //   e.currentTarget.children[1].children[i].style.lineHeight = "20px"
        // })
      }} 
      style={style.profileListContainer}>
        {renderListDataMain()}
        <div style={{display: "flex", width: "100%"}}>
          {renderListDataOther()}
        </div>
      </div>
      <div style={{height: "3px"}}></div>
    </div>
  )
}
